    <script type=""text/javascript"">


        function formatDate(date) {
            date = new Date(date);
            var year = date.getFullYear();
            var month = date.getMonth() + 1;
            var day = date.getDate()
            if (day < 10) {
                day = '0' + day
            }
            if (day < 10) {
                month = '0' + month
            }
            return day + ""-"" + month + ""-"" + year
        }



        function setCookie(cname, cvalue, exdays) {
            var d = new Date();
            d.setTime(d.getTime() + (exdays * 24 * 60 * 60 * 1000));
            var expires = ""expires="" + d.toUTCString();
            document.cookie = cname + ""="" + cvalue + "";"" + expires + "";path=/"";
            //location.reload(true);
        }

        function getCookie(name) {
            var re = new RegExp(name + ""=([^;]+)"");
            var value = re.exec(document.cookie);
            return (value != null) ? unescape(value[1]) : nul");
                WriteLiteral(@"l;
        }
        setCookie('lang', 'en', 30);

        function fnSelectedEmployee(id, name, empCode, rank, rankId, color, postingPlace) {
            $('#selEmpDiv').show()
            var data = '';
            var check = $(`#slEmpList-${id}`).val();
            if (check == id) {
                $(`#emp-${id}`).hide();
                return false;
            }
            else {
                $(`#emp-${id}`).hide();
                data = `<li class=""dd-item"" id=""slEmp-${id}"">
                                            <input type=""hidden"" name=""empId"" id=""slEmpList-${id}"" value=""${id}""/>
                                            <input type=""hidden"" name=""empCode"" value=""${empCode}""/>
                                            <input type=""hidden"" name=""empRank"" value=""${rankId}""/>
                                            <div class=""dd-handle row fontStyle"" style=""background-color:${color};height: 50px;border-radius: 10px;padding: 0;margin: 0;padding-top: 4px;color: blac");
                WriteLiteral(@"k;font-weight: bold;""><span class=""col-11"">${name},${empCode},${rank},${postingPlace} </span><span class=""col-1 badge float-right"" style=""background-color: white;color:red; height: 23px;width: 20px;"" onclick=""removeFromSelectedDiv(${id})""><i class=""fa fa-times fa-1x""></i></span></div>
                                        </li>`;
                //var selectedEmpArr = JSON.parse(localStorage.getItem('EmpData') || '[]');
                //selectedEmpArr.push(id);
                //localStorage.setItem('EmpData', JSON.stringify(selectedEmpArr));
            }
